import React from 'react'
import Select from 'react-select'

const rooms = [
    "110","111","120","121"
]

const selectStyle = {    
    control: (base) => ({
        width: 300,
    }),

}

const Home = () => {
    return (
        <div>
            <h3>Room</h3>
            <Select styles={selectStyle} options={rooms}></Select>

        </div>
    )
}

export default Home
